const dotenv = require("dotenv")
const path = require("path")
dotenv.config({path: path.join(__dirname, "../env/config.env")})

console.log(dotenv)

const client = require("./db_conn.js")

const createWriting = async () =>{
    const writing = {
        writing_type: "short story",
        tags: ["fantasy"],
        title: "Test",
        description: "A test story",
        thumbnail: "data:image/jpeg;base64,",
        creator_thumbnail: "data:image/png;base64,",
        creator_name: "Griegor Speck",
        url_id: "/Griegor%20Speck/Test"
    }

    try {
        const res = await client.db('stoicelm').collection("writing").insertOne(writing)
        console.log(res)
        const content = {
            writing_id: res.insertedId,
            content: "Just some dummy test content",
            title: writing.title,
            url_id: writing.url_id
        }
        const result = await client.db('stoicelm').collection("content").insertOne(content)
        console.log(result)
    } catch(error){
        console.error(error)
    }finally{
       await client.close()
       process.exit(0)
    }
}

createWriting()